import React from 'react';
import classes from './SecondPost.module.css'
import {NavLink} from "react-router-dom";


const DialigItem = (props) => {
    let path = '/dialog/' + props.id;

    return <div className={classes.dialog}>
        <NavLink to={path}>{props.name}</NavLink>
    </div>
}
 const MessageSend = (props) => {
   return <div className={classes.messageSend}>
       {props.message}
   </div>
 }
 let dialogsData = [
     {id: 1, name: 'Dima'},
     {id: 2, name: 'Andre'},
     {id: 3, name: 'Sasha'},
 ]
let dialogsElements = dialogsData
    .map( dialog => <DialigItem name={dialog.name} id={dialog.id}/>);

 let messagesData = [
     {id: 1, message: 'hi'},
     {id: 2, message: 'hi'},
     {id: 3, message: 'hi'},
     {id: 4, message: 'hi'},
 ]
let messagesElements = messagesData
    .map(message => <MessageSend message={messagesData.message} />);

const SecondPost = (props) => {
    return (
        <div className={classes.dialogs}>
            <div className={classes.dialogsItem}>

                <DialigItem name={dialogsData[0].name} id={dialogsData[0].id}/>
                <DialigItem name={dialogsData[1].name} id={dialogsData[1].id}/>
                <DialigItem name={dialogsData[2].name} id={dialogsData[2].id}/>
            </div>
            <div className={classes.messages}>
                <MessageSend message={messagesData[0].message} />
                <MessageSend message={messagesData[1].message}/>
                <MessageSend message='ho'/>

            </div>
        </div>
    );
};

export default SecondPost;
